        <Dummy text="Calendar" />
        <Button text="button1" />
        <Button text="button2" />
        <Button text="button3" />
        <Button text="button4" />
        <Select1 text="select" />

        <Select2 text="select" />

    </div>


);


DummyBig.propTypes = {
    /** Description of prop "text". */
    text: PropTypes.string
};

DummyBig.defaultProps = {
    text: 'defaultText'
};

export default DummyBig;
